import React from 'react';
import Search from "./components/searchbar"
import Youtube from "./components/youtube"
import Detail from "./components/videodetail"
import List from "./components/videolist"

function App() {
  return (
    <div>
      <Search></Search>
      <Youtube></Youtube>
      <List></List>
      <Detail></Detail>
    </div>
  );
}

export default App;
